<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <title>3D Point Cloud Visualization</title>
    <style>
        body { 
            margin: 0; 
            overflow: hidden;
            font-family: Arial, sans-serif;
        }
        #info {
            position: absolute;
            top: 10px;
            left: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
        }
        #controls {
            position: absolute;
            bottom: 10px;
            left: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
            font-size: 12px;
        }
        #coordinates {
            position: absolute;
            bottom: 10px;
            right: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
            font-size: 12px;
            min-width: 150px;
        }
        #categoryPanel {
            position: absolute;
            top: 10px;
            right: 10px;
            background: rgba(26, 26, 26, 0.95);
            color: white;
            padding: 15px;
            border-radius: 8px;
            z-index: 100;
            max-height: calc(100vh - 20px);
            overflow-y: auto;
            min-width: 250px;
            max-width: 350px;
        }
        #categoryPanel h3 {
            margin: 0 0 10px 0;
            color: #4fc3f7;
            font-size: 16px;
        }
        #categoryTable {
            width: 100%;
            border-collapse: collapse;
            font-size: 12px;
        }
        #categoryTable th {
            background: #2a2a2a;
            padding: 6px 8px;
            text-align: left;
            font-size: 11px;
        }
        #categoryTable td {
            padding: 4px 8px;
            border-bottom: 1px solid #333;
        }
        #categoryTable tr:hover {
            background: rgba(79, 195, 247, 0.1);
        }
        .color-swatch {
            display: inline-block;
            width: 12px;
            height: 12px;
            border-radius: 2px;
            margin-right: 6px;
        }
    </style>
</head>

            controls.update();
            renderer.render(scene, camera);
        }
        animate();
    </script>
</body>
</html>
